description:
This torrent contains 4 books on statistics that I have downloaded from various sites.
All are latest editions except Sally Caldwell's Statistics Unplugged whose 4th ed will be out next month:

Introductory Statistics (7th Ed)
by Prem S. Mann
Wiley | February 2010 | ISBN-10: 0470444665 | PDF | 744 pages | 12 mb &lt;a href=&quot;
http://www.amazon.com/Introductory-Statistics-Prem-S-Mann/dp/0470444665&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.amazon.com/Introductory-Statistics-Prem-S-Mann/dp/0470444665&lt;/a&gt;

